import React, { useState } from "react";
import {
  Text,
  View,
  StyleSheet,
  SafeAreaView,
  TouchableOpacity,
  Button,
} from "react-native";

import { TextInput, ScrollView } from "react-native";
import axios from "axios";

export const SP2= ({ route, navigation }) => {
  const [rating, Setrate] = useState("");
  const [landLine, Setland_line] = useState("");
  const [verificationDocuments,SetVerificationDocuments ] = useState("");

  const {
    name,
    username,
    phoneNumber,
    email,
    password,
    passwordConfirm,
    nationalID,
    address,
    country,
    city,
    role,
    image,
    type,
    workingHours,
    finishingHour,
    maxNumberClients,
    offDays,
    ratePerHour,
  } = route.params;

  async function signup() {
    let user = {
      name: name,
      email: email,
      password: password,
      passwordConfirm: passwordConfirm,
      userName: username,
      nationalID: nationalID,
      city: city,
      country: country,
      address: address,
      phoneNumber: phoneNumber,
      role: role,
      profilePicture: image,
      serviceProvider: {
        type: type,
        rating: rating,
        workingHours: workingHours,
        finishingHour: finishingHour,
        maxNumberClients: maxNumberClients,
        offDays: offDays,
        ratePerHour: ratePerHour,
        landLine: landLine,
        verificationDocuments: verificationDocuments,
      },
    };
    console.warn(user);
    await axios
      .post("https://petzone99.herokuap
p.com/api/v1/users/signup", user, {
        headers: {
          "Content-Type": "application/json",
          "My-Custom-Header": "foobar",
          Authorization: "Bearer my-token",
        },
      })
      .then(function (response) {
        navigation.navigate("Home");
      })
      .catch(function (error) {
        console.log(error);
      });
  }
  return (
    <View style={styles.container1}>

      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter rating"
          onChangeText={(rating) => Setrate(rating)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>


      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter landLine"
          onChangeText={(landLine) => Setland_line(landLine)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>
      


      <View style={styles.input}>
        <TextInput
          style={styles.inputtext1}
          placeholder="Enter verificationDocuments"
          onChangeText={(verificationDocuments) => SetVerificationDocuments(verificationDocuments)}
          onEndEditing={(e) => handelRequiredType(e.nativeEvent.text)}
          placeholderTextColor="gray"
        />
      </View>

      <TouchableOpacity style={styles.buttoncontainer1} onPress={signup}>
        <Text style={styles.buttontext1}>Next</Text>
      </TouchableOpacity>

    </View>
  );
};
const styles = StyleSheet.create({
  container1: {
    backgroundColor: "rgb(245, 245, 245)",
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    paddingTop: 120,
    paddingBottom: 60,
  },
  input: {
    flexDirection: "row",
  },
  inputtext1: {
    borderRadius: 9,
    width: 250,
    height: 40,
    borderColor: "rgb(48, 71, 94)",
    borderWidth: 1,
    paddingHorizontal: 10,
    fontSize: 15,
    color: "black",
    marginVertical: 10,
  },
  errormsg: {
    bottom: 5,
    paddingRight: 199,
    color: "red",
  },
  buttoncontainer1: {
    borderRadius: 15,
    width: 150,
    height: 45,
    backgroundColor: "rgb(240, 84, 84)",
    paddingTop: 1,
    justifyContent: "center",
    marginTop: 30,
    marginBottom: 30,
    paddingLeft: 60,
  },
  buttontext1: {
    textAlign: "center",
    color: "black",
    fontSize: 15,
    right: 25,
  },
});
